import React from "react";

const OutputWindow = ({ outputDetails }) => {
  return (
    <div className="flex flex-col mt-5 max-md:max-w-full">
      <h2 className="max-md:max-w-full">Output</h2>
      <div className="relative bg-base-white dark:bg-gray-900 border border-solid border-zinc-200 dark:border-zinc-600 rounded-md p-4 max-md:max-w-full">
        <div className="text-xs text-gray-600 dark:text-gray-400 font-bold tracking-wide mb-2">
          {/* Output window */}
        </div>
        <pre className="text-base-black dark:text-base-white font-mono whitespace-pre-wrap max-md:max-w-full">
          {outputDetails ? outputDetails.output : ""}
        </pre>
      </div>
    </div>
  );
};

export default OutputWindow;
